import React from "react";

class OnionHater extends React.Component {
  render() {
    const onKeyUpListener = (ev) => {
      alert("Odio la cebolla");
    };
    return (
      <textarea className='textarea' onKeyUp={onKeyUpListener}>
        Escribe algo
      </textarea>
    );
  }
}

export default OnionHater;
